import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import { Food } from './models/Food';
import { FoodData } from './testData/FoodData';
import { FoodTile } from './models/FoodComp';

function App() {
  const [food, setFood] = useState<Food[]>(FoodData)
  return (
    <div className="App">
    <FoodTile data={food[0]}/>
    </div>
  );
}

export default App;
